import { css, SupersetTheme } from '@superset-ui/core';
import { NULL_DISPLAY } from 'src/constants';

function NullCell() {
  return (
    <span
      css={(theme: SupersetTheme) => css`
        color: ${theme.colors.grayscale.light1};
      `}
    >
      {NULL_DISPLAY}
    </span>
  );
}

export default NullCell;
